import React, { Fragment } from "react";

const BudgetCount = ({ budget, remainingBudget }) => {
  return (
    <Fragment>
      <div className="alert alert-primary">Budget: {budget}</div>
      <div className="alert ">Remaining: {remainingBudget}</div>
    </Fragment>
  );
};

export default BudgetCount;
